        console.log(e)
    }

    return(
        <section>
            <h1 className="mt-2 text-center"><i class="fa-solid fa-registered fa-fade fa-2xl"></i></h1>
            <div className="row">
                <div className="col-md-6 mx-auto">
                    <form>
                        <div className="form-group">
                            <input
                            type="text"
                            name="phone"
                            value={data.phone}
                            onChange={handleChange}
                            />
                        </div>
                    </form>
                </div>
            </div>
        </section>
    )
}

export default Register
